import styled from "styled-components";

export const AddUserDiv = styled.div`
  transition: all 1s;
  width: 100%;
  height: 70%;
  background-color: white;
  margin-top: 20%;
  padding: 2em;
  box-sizing: border-box;
  z-index: 1000;
`;
